import React from "react";
import Link from "next/link";

function Index() {
    return (
        <div>
            <header>
                <Link href="/about" title="About page">
                    <a>About page</a>
                </Link>
            </header>
            <div>
                Hello Next.js
            </div>
        </div>
    )
}

export default Index;
